import API from "../../utils/API";


function DataArea() {

    const [users, setUsers] = useState([]);

    useEffect(() => {
        API.getUsers()
      .then(res => {
        setUsers(res.data.results)
      })
      .catch(err => console.log(err));
      }, []);
      console.log(users)

    return (
        <div>
            {users.map(user => (
                <div>{user.gender}</div>
            ))}
        </div>
    )
}

export default DataArea;
